import { takeLatest } from "redux-saga/effects";
import axios from "axios";

function* fetchKeySaga() {
  console.log('in fetchKeySaga');
  yield axios({
    method: 'GET',
    url: '/api/key',
  });
  yield put({
    type: "SET_KEY",
    payload: response.data,
  });
}

function* keySaga() {
  yield takeLatest('GET_KEY', fetchKeySaga);
}

export default keySaga;
